    [],nt"num_tags": 7,nt"name": "narrative-report-brigantine-national-wildlife-refuge-period-ending-december-31-1961",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Brigantine NWR
    outlines Refuge accomplishments from September through December of 1961. The report
    begins by summarizing the weather conditions, habitat conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
    reptiles, and fish- is also covered. The Refuge development and maintenance section
    discusses physical developments, plantings, and collections and receipts. The public
    relations section of the report describes recreational uses, Refuge visitors, Refuge
    participation, hunting, violations, and safety. Items of interest, N-R forms, and
    photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
